script: |
  super -f text -I q8384.spq | sort > q8384.out

inputs:
  - name: q8384.spq
    data: |
      SELECT - CAST ( NULL AS INTEGER ) + - ( col2 ) + + col2 + + col0 * 39 / - col2 AS col1 FROM tab2 (FORMAT parquet) WHERE NULL NOT IN ( + col1 + + col2 );
  - name: tab2

outputs:
  - name: q8384.out
    data: |
